import React from 'react';
import './Item.css';


function Item(props) {
    return (
      <div className="addnew-item">
          <div className="todo-item-date">
              <span className="day">{props.item.date.toLocaleString('default', { day: 'numeric' })}</span>
              <span className="month">{props.item.date.toLocaleString('default', { month: 'short' })}</span>
          </div>
          <div className="todo-item-content">
              <span className="firstname">{props.item.firstname}</span>
              <span className="lastname">{props.item.lastname}</span>
              <span className="number">{props.item.number}</span>
          </div>
          <span className="delete-btn" title="delete" onClick={(e) => {
              e.stopPropagation();
              props.onDeleteItem(props.items);
          }}></span>
      </div>
    );
}

export default Item;
